import React, { useState, useEffect } from 'react';
import { Search, Users, Activity, Filter, Download, AlertCircle, CheckCircle } from 'lucide-react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';

const FHIRQueryApp = () => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [suggestions, setSuggestions] = useState([]);
  const [showSuggestions, setShowSuggestions] = useState(false);
  const [filters, setFilters] = useState({
    minAge: '',
    maxAge: '',
    gender: '',
    condition: ''
  });

  const querySuggestions = [
    "Show me all diabetic patients over 50",
    "Find patients with hypertension under 65",
    "Get all patients with heart disease between 40 and 70",
    "How many patients have asthma?",
    "List patients with depression",
    "Show me female patients with diabetes",
    "Find male patients over 60 with heart disease"
  ];

  const conditionColors = {
    'Type 2 diabetes mellitus': '#FF6B6B',
    'Essential hypertension': '#4ECDC4',
    'Chronic ischemic heart disease': '#45B7D1',
    'Asthma': '#96CEB4',
    'Major depressive disorder': '#FFEAA7',
    'Malignant neoplasm': '#DDA0DD'
  };

  useEffect(() => {
    if (query.length > 2) {
      const filtered = querySuggestions.filter(s => 
        s.toLowerCase().includes(query.toLowerCase())
      );
      setSuggestions(filtered);
      setShowSuggestions(true);
    } else {
      setShowSuggestions(false);
    }
  }, [query]);

  const handleQuery = async () => {
    if (!query.trim()) return;

    setLoading(true);
    setError(null);

    try {
      const response = await fetch('http://localhost:5000/query', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ query: query.trim() }),
      });

      if (!response.ok) {
        throw new Error('Failed to process query');
      }

      const data = await response.json();
      setResults(data);
      setShowSuggestions(false);
    } catch (err) {
      setError('Error processing query. Make sure the backend server is running.');
      console.error('Query error:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleSuggestionClick = (suggestion) => {
    setQuery(suggestion);
    setShowSuggestions(false);
  };

  const getFilteredResults = () => {
    if (!results?.mock_fhir_response?.entry) return [];

    return results.mock_fhir_response.entry
      .map(entry => entry.resource)
      .filter(patient => {
        if (filters.minAge && patient.age < parseInt(filters.minAge)) return false;
        if (filters.maxAge && patient.age > parseInt(filters.maxAge)) return false;
        if (filters.gender && patient.gender !== filters.gender) return false;
        if (filters.condition) {
          const hasCondition = patient.conditions?.some(cond => 
            cond.code.coding[0].display.toLowerCase().includes(filters.condition.toLowerCase())
          );
          if (!hasCondition) return false;
        }
        return true;
      });
  };

  const getChartData = () => {
    const filteredResults = getFilteredResults();
    const ageGroups = {
      '0-30': 0,
      '31-50': 0,
      '51-70': 0,
      '70+': 0
    };

    filteredResults.forEach(patient => {
      if (patient.age <= 30) ageGroups['0-30']++;
      else if (patient.age <= 50) ageGroups['31-50']++;
      else if (patient.age <= 70) ageGroups['51-70']++;
      else ageGroups['70+']++;
    });

    return Object.entries(ageGroups).map(([range, count]) => ({
      ageRange: range,
      count
    }));
  };

  const getConditionData = () => {
    const filteredResults = getFilteredResults();
    const conditionCounts = {};

    filteredResults.forEach(patient => {
      patient.conditions?.forEach(condition => {
        const display = condition.code.coding[0].display;
        conditionCounts[display] = (conditionCounts[display] || 0) + 1;
      });
    });

    return Object.entries(conditionCounts).map(([condition, count]) => ({
      name: condition,
      value: count,
      color: conditionColors[condition] || '#8884d8'
    }));
  };

  const exportResults = () => {
    const dataStr = JSON.stringify(results, null, 2);
    const dataUri = 'data:application/json;charset=utf-8,'+ encodeURIComponent(dataStr);
    const exportFileDefaultName = 'fhir_query_results.json';

    const linkElement = document.createElement('a');
    linkElement.setAttribute('href', dataUri);
    linkElement.setAttribute('download', exportFileDefaultName);
    linkElement.click();
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100">
      <div className="container mx-auto px-4 py-8">
        {/* Header */}
        <div className="text-center mb-8">
          <h1 className="text-4xl font-bold text-gray-800 mb-2">
            AI-Powered FHIR Query System
          </h1>
          <p className="text-gray-600">
            Query healthcare data using natural language
          </p>
        </div>

        {/* Query Input */}
        <div className="bg-white rounded-lg shadow-lg p-6 mb-8">
          <div className="relative">
            <div className="flex items-center space-x-4">
              <div className="flex-1 relative">
                <Search className="absolute left-3 top-3 h-5 w-5 text-gray-400" />
                <input
                  type="text"
                  value={query}
                  onChange={(e) => setQuery(e.target.value)}
                  onKeyPress={(e) => e.key === 'Enter' && handleQuery()}
                  placeholder="Enter your query (e.g., 'Show me all diabetic patients over 50')"
                  className="w-full pl-10 pr-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />

                {/* Suggestions Dropdown */}
                {showSuggestions && suggestions.length > 0 && (
                  <div className="absolute z-10 w-full mt-1 bg-white border border-gray-300 rounded-lg shadow-lg max-h-60 overflow-y-auto">
                    {suggestions.map((suggestion, index) => (
                      <div
                        key={index}
                        onClick={() => handleSuggestionClick(suggestion)}
                        className="px-4 py-2 hover:bg-gray-50 cursor-pointer border-b border-gray-100 last:border-b-0"
                      >
                        {suggestion}
                      </div>
                    ))}
                  </div>
                )}
              </div>

              <button
                onClick={handleQuery}
                disabled={loading || !query.trim()}
                className="px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed flex items-center space-x-2"
              >
                {loading ? (
                  <>
                    <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white"></div>
                    <span>Processing...</span>
                  </>
                ) : (
                  <>
                    <Search className="h-4 w-4" />
                    <span>Query</span>
                  </>
                )}
              </button>
            </div>
          </div>
        </div>

        {/* Error Display */}
        {error && (
          <div className="bg-red-50 border border-red-200 rounded-lg p-4 mb-8 flex items-center space-x-2">
            <AlertCircle className="h-5 w-5 text-red-500" />
            <span className="text-red-700">{error}</span>
          </div>
        )}

        {/* Results */}
        {results && (
          <div className="space-y-8">
            {/* Query Analysis */}
            <div className="bg-white rounded-lg shadow-lg p-6">
              <h2 className="text-xl font-semibold mb-4 flex items-center space-x-2">
                <CheckCircle className="h-5 w-5 text-green-500" />
                <span>Query Analysis</span>
              </h2>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <div>
                  <h3 className="font-medium text-gray-700 mb-2">Original Query:</h3>
                  <p className="text-gray-600 bg-gray-50 p-3 rounded">{results.original_query}</p>
                </div>
                <div>
                  <h3 className="font-medium text-gray-700 mb-2">Extracted Intent:</h3>
                  <div className="bg-gray-50 p-3 rounded">
                    <p><strong>Action:</strong> {results.extracted_intent.action}</p>
                    <p><strong>Resource:</strong> {results.extracted_intent.resource_type}</p>
                    {results.extracted_intent.conditions.length > 0 && (
                      <p><strong>Conditions:</strong> {results.extracted_intent.conditions.map(c => c.display).join(', ')}</p>
                    )}
                    {results.extracted_intent.age_filter && (
                      <p><strong>Age Filter:</strong> {JSON.stringify(results.extracted_intent.age_filter)}</p>
                    )}
                  </div>
                </div>
              </div>
            </div>

            {/* Filters */}
            <div className="bg-white rounded-lg shadow-lg p-6">
              <h2 className="text-xl font-semibold mb-4 flex items-center space-x-2">
                <Filter className="h-5 w-5 text-blue-500" />
                <span>Filters</span>
              </h2>
              <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Min Age</label>
                  <input
                    type="number"
                    value={filters.minAge}
                    onChange={(e) => setFilters({...filters, minAge: e.target.value})}
                    className="w-full px-3 py-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Max Age</label>
                  <input
                    type="number"
                    value={filters.maxAge}
                    onChange={(e) => setFilters({...filters, maxAge: e.target.value})}
                    className="w-full px-3 py-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500"
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Gender</label>
                  <select
                    value={filters.gender}
                    onChange={(e) => setFilters({...filters, gender: e.target.value})}
                    className="w-full px-3 py-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500"
                  >
                    <option value="">All</option>
                    <option value="male">Male</option>
                    <option value="female">Female</option>
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">Condition</label>
                  <input
                    type="text"
                    value={filters.condition}
                    onChange={(e) => setFilters({...filters, condition: e.target.value})}
                    placeholder="Search conditions..."
                    className="w-full px-3 py-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-500"
                  />
                </div>
              </div>
            </div>

            {/* Charts */}
            <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
              {/* Age Distribution */}
              <div className="bg-white rounded-lg shadow-lg p-6">
                <div className="flex justify-between items-center mb-4">
                  <h2 className="text-xl font-semibold flex items-center space-x-2">
                    <Activity className="h-5 w-5 text-green-500" />
                    <span>Age Distribution</span>
                  </h2>
                </div>
                <ResponsiveContainer width="100%" height={300}>
                  <BarChart data={getChartData()}>
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="ageRange" />
                    <YAxis />
                    <Tooltip />
                    <Bar dataKey="count" fill="#3B82F6" />
                  </BarChart>
                </ResponsiveContainer>
              </div>

              {/* Condition Distribution */}
              <div className="bg-white rounded-lg shadow-lg p-6">
                <div className="flex justify-between items-center mb-4">
                  <h2 className="text-xl font-semibold flex items-center space-x-2">
                    <Activity className="h-5 w-5 text-purple-500" />
                    <span>Condition Distribution</span>
                  </h2>
                </div>
                <ResponsiveContainer width="100%" height={300}>
                  <PieChart>
                    <Pie
                      data={getConditionData()}
                      cx="50%"
                      cy="50%"
                      labelLine={false}
                      label={({name, percent}) => `${name} (${(percent * 100).toFixed(0)}%)`}
                      outerRadius={80}
                      fill="#8884d8"
                      dataKey="value"
                    >
                      {getConditionData().map((entry, index) => (
                        <Cell key={`cell-${index}`} fill={entry.color} />
                      ))}
                    </Pie>
                    <Tooltip />
                  </PieChart>
                </ResponsiveContainer>
              </div>
            </div>

            {/* Results Table */}
            <div className="bg-white rounded-lg shadow-lg p-6">
              <div className="flex justify-between items-center mb-4">
                <h2 className="text-xl font-semibold flex items-center space-x-2">
                  <Users className="h-5 w-5 text-blue-500" />
                  <span>Patient Results ({getFilteredResults().length})</span>
                </h2>
                <button
                  onClick={exportResults}
                  className="flex items-center space-x-2 px-4 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700"
                >
                  <Download className="h-4 w-4" />
                  <span>Export</span>
                </button>
              </div>

              <div className="overflow-x-auto">
                <table className="min-w-full table-auto">
                  <thead>
                    <tr className="bg-gray-50">
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Name</th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Age</th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Gender</th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Birth Date</th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Conditions</th>
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {getFilteredResults().map((patient, index) => (
                      <tr key={patient.id} className={index % 2 === 0 ? 'bg-white' : 'bg-gray-50'}>
                        <td className="px-4 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                          {patient.name[0].given[0]} {patient.name[0].family}
                        </td>
                        <td className="px-4 py-4 whitespace-nowrap text-sm text-gray-500">
                          {patient.age}
                        </td>
                        <td className="px-4 py-4 whitespace-nowrap text-sm text-gray-500 capitalize">
                          {patient.gender}
                        </td>
                        <td className="px-4 py-4 whitespace-nowrap text-sm text-gray-500">
                          {patient.birthDate}
                        </td>
                        <td className="px-4 py-4 text-sm text-gray-500">
                          {patient.conditions?.map((condition, idx) => (
                            <span key={idx} className="inline-block bg-blue-100 text-blue-800 text-xs px-2 py-1 rounded-full mr-1 mb-1">
                              {condition.code.coding[0].display}
                            </span>
                          )) || 'No conditions'}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default FHIRQueryApp;
